import React from 'react';
import { Link } from 'react-router-dom';

export default function Header() {
  return (
    <header className="flex justify-between items-center px-8 py-6 max-w-6xl mx-auto w-full">
      <div className="flex items-center gap-3">
        <img src="/logo192.png" alt="Logo NovaWeb" className="w-10 h-10 rounded-full bg-blue-600" />
        <span className="text-2xl font-bold tracking-tight">NovaWeb</span>
      </div>
      <nav aria-label="Menu principal">
        <ul className="flex gap-8 text-sm font-medium">
          <li><Link to="/">Accueil</Link></li>
          <li><Link to="/services">Services</Link></li>
          <li><Link to="/realisations">Réalisations</Link></li>
          <li><Link to="/about">À propos</Link></li>
          <li><Link to="/contact">Contact</Link></li>
        </ul>
      </nav>
    </header>
  );
}
